import{_ as o,o as a,c as t,z as e,a as r}from"./chunks/framework.9482e208.js";const b=JSON.parse('{"title":"§ 54.1-3414 Official orders for Schedule II drugs.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/54.1-3414.md","filePath":"vacode/54.1-3414.md"}'),s={name:"vacode/54.1-3414.md"},i=e("h1",{id:"§-54-1-3414-official-orders-for-schedule-ii-drugs",tabindex:"-1"},[r("§ 54.1-3414 Official orders for Schedule II drugs. "),e("a",{class:"header-anchor",href:"#§-54-1-3414-official-orders-for-schedule-ii-drugs","aria-label":'Permalink to "§ 54.1-3414 Official orders for Schedule II drugs."'},"​")],-1),c=e("p",null,"An official written order for any Schedule II drug shall be signed by the purchasing licensee or by his agent. The original shall be presented to the person who supplies the drug or drugs. If such person accepts the order, each party to the transaction shall preserve his copy of the order for two years in such a way as to be readily accessible for inspection by any public officer or employee engaged in the enforcement of this chapter. It shall be deemed a compliance with this section if the parties to the transaction have complied with the federal laws respecting the requirements governing the use of order forms. Parties ordering Schedule II drugs electronically shall comply with all requirements of federal law and regulation governing such transactions.",-1),n=e("p",null,[r("Code 1950, § 54-493; 1970, c. 650, § 54-524.60; 1988, c. 765; 2006, c. "),e("a",{href:"http://lis.virginia.gov/cgi-bin/legp604.exe?061+ful+CHAP0346",target:"_blank",rel:"noreferrer"},"346"),r(".")],-1),l=[i,c,n];function d(h,f,p,u,g,_){return a(),t("div",null,l)}const y=o(s,[["render",d]]);export{b as __pageData,y as default};
